package Account

import . "DNO/handin/Cryptography"

var keyPairs = []KeyPair{
		{ Pk: ToPublicKey(":3"),
			Sk:ToSecretKey(":")},

		{ Pk: ToPublicKey(":3"),
			Sk:ToSecretKey(":")},

		{ Pk: ToPublicKey(":3"),
			Sk:ToSecretKey(":")},

		{ Pk: ToPublicKey(":3"),
			Sk:ToSecretKey(":")},

		{ Pk: ToPublicKey(":3"),
			Sk:ToSecretKey(":")},

		{ Pk: ToPublicKey(":3"),
			Sk:ToSecretKey(":")},

		{ Pk: ToPublicKey(":3"),
			Sk:ToSecretKey(":")},

		{ Pk: ToPublicKey(":3"),
			Sk:ToSecretKey(":")},

		{ Pk: ToPublicKey(":3"),
			Sk:ToSecretKey(":")},

		{ Pk: ToPublicKey(":3"),
			Sk:ToSecretKey(":")},
	}

func GetHardcodedAccKeyPairs() []KeyPair {
	return keyPairs
}

func GetHardcodedAccPublicKeys() []PublicKey {
	var pks []PublicKey
	for _, pair := range keyPairs {
		pks = append(pks, pair.Pk)
	}
	return pks
}

